    false,nt"url": null,nt"notes": "Designated Areas - as of October 1, 2015.
    A designation is the term EPA uses to describe the air quality in a given area for
    any of six common air pollutants known as criteria pollutants. After EPA establishes
    or revises a primary and/or secondary National Ambient Air Quality Standard (NAAQS),
    the Clean Air Act requires EPA to designate areas as u00e2??attainmentu00e2?? (meeting),
    u00e2??nonattainmentu00e2?? (not meeting), or u00e2??unclassifiableu00e2?? (insufficient
    data) after monitoring data is collected by state, local and tribal governments.
    Once nonattainment designations take effect, the state and local governments have
    three years to develop implementation plans outlining how areas will attain and
    maintain the standards by reducing air pollutant emissions. Air Quality Systems
    (AQS) 2012-2014 Design Value Data - as of October 1, 2015. A design value is a statistic
    that describes the air quality status of a given location relative to the level
    of the National Ambient Air Quality Standards (NAAQS).",nt"license_title":
